import React,{useState} from 'react';

export const Items =()=>{
    const [{name,age}, setState]= useState({});
    const onChange=(e)=>{
        setState([e.target.name]=[e.target.value])
    }
    return(
        <div>
            <form>
                <input type="text" value={name} onChange={onChange} name="name"/>
                <input type="text" value={age} onChange={onChange} name="age"/>
            </form>
        </div>
    )
}
